package main

import (
	"fmt"
	"os"

	"github.com/poohvpn/tray"
)

func main() {
	t, err := tray.NewTray(tray.TrayOption{
		// convert ico file to base64 online: https://base64.guru/converter/encode/image/ico
		Icon:    `base64:`,
		ToolTip: "this is tooltip",
		LeftClickCallback: func() {
			fmt.Println("left")
		},
		RightClickCallback: func() {
			fmt.Println("right")
		},
		Children: []tray.ItemOption{
			{
				Title: "test",
				Callback: func() {
					fmt.Println("test")
				},
			},
			{
				Icon:  "stop.ico",
				Title: "icon item",
				Callback: func() {
					fmt.Println("icon item")
				},
			},
			{
				Icon:  "stop.ico",
				Title: "submenu",
				Callback: func() {
					// On Linux, callback() when submenu is selected
					fmt.Println("submenu")
				},
				Children: []tray.ItemOption{
					{
						Title: "sub1",
						Callback: func() {
							fmt.Println("sub1")
						},
						Children: []tray.ItemOption{
							{
								Title: "sub2",
								Callback: func() {
									fmt.Println("sub2")
								},
							},
						},
					},
				},
			},
			{}, // add Separator
			{
				Icon:  "-", // align start trick with icon item for linux
				Title: "align",
			},
			{
				Title:     "invisible item",
				Invisible: true,
			},
			{
				Title:    "disabled item",
				Disabled: true,
			},
		},
	})
	if err != nil {
		panic(err)
	}

	checkItem, err := t.AddItem(tray.ItemOption{
		Title:     "checkable item",
		Checkable: true,
		Checked:   true,
		Callback: func() {
			println("checkable item original callback, this callback will be removed")
		},
	})
	if err != nil {
		panic(err)
	}

	err = checkItem.SetCallback(func() {
		fmt.Printf("checkable item checked: %v\n", checkItem.Checked())
	})
	if err != nil {
		panic(err)
	}

	_, err = t.AddItem(tray.ItemOption{})
	if err != nil {
		panic(err)
	}

	_, err = t.AddItem(tray.ItemOption{
		Icon:  "stop.ico",
		Title: "exit",
		Callback: func() {
			println("closing...")
			err := t.Close()
			if err != nil {
				panic(err)
			}
			os.Exit(0)
		},
	})
	if err != nil {
		panic(err)
	}
	println("tray is running...")
	t.Run()
}
